import pytest
from index import bigSorting


def test_single_value_in_array():
    arr = ['1']
    
    sorted_arr = bigSorting(arr)
    
    assert sorted_arr == arr
    
def test_empty_array():
    arr = []
    
    sorted_arr = bigSorting(arr)
    
    assert sorted_arr == arr

def test_integer_array():
    arr = [1, 2]
    expected = [1, 2]
    sorted_array = bigSorting(arr)
    assert sorted_array == expected

@pytest.mark.parametrize("arr,expected", [
    (['2', '1'],['1', '2']),
    (['2', '1','2', '1'],['1', '1', '2', '2']),
    (['1234567891011121314', '1312',],['1312', '1234567891011121314']),
    (['1234567891011121314', '1234567891011121314'],['1234567891011121314', '1234567891011121314']),
    (['123456789101112131415', '123456789101112131415','123456789101112131415', '123456789101112131415','123456789101112131415', '123456789101112131415','123456789101112131415', '123456789101112131415','123456789101112131415', '123456789101112131415','123456789101112131415', '123456789101112131415','123456789101112131415', '123456789101112131415','123456789101112131415', '123456789101112131415','123456789101112131415', '123456789101112131415','123456789101112131415', '123456789101112131415',],
    ['123456789101112131415', '123456789101112131415','123456789101112131415', '123456789101112131415','123456789101112131415', '123456789101112131415','123456789101112131415', '123456789101112131415','123456789101112131415', '123456789101112131415','123456789101112131415', '123456789101112131415','123456789101112131415', '123456789101112131415','123456789101112131415', '123456789101112131415','123456789101112131415', '123456789101112131415','123456789101112131415', '123456789101112131415',],
    )
    ])    
def test_sorted_correctlly(arr, expected):
    
    sorted_array = bigSorting(arr)
